import React, { useEffect, useState } from "react";
import CurrencyList from "./CurrencyList";

function CurrencyFinder(data) {
  data.rates.filter((item) => {
    let abc = CurrencyList.state.currency.indexOf(item);
    console.log(abc);
  });
}

function CurrencyTable() {
  const API_KEY = "0b60f0b4714045e88e359d451481ce44";
  const [currency, setCurrency] = useState(1);

  useEffect(() => {
    fetch(`https://api.currencyfreaks.com/latest?apikey=${API_KEY}`)
      .then((res) => res.json())
      .then((data) => {
        CurrencyFinder(data);
        // console.log(data.rates.FJD);
        // setCurrency(data)
        // console.log(data.length)
      })
      .catch((err) => console.log(err));
  }, [API_KEY]);

  return (
    <>
      {console.log(currency)}
      <table className="table">
        <thead>
          <tr>
            <th>Currency</th>
            <th>We Buy</th>
            <th>Exchange Rate</th>
            <th>We Sell</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>FJD</td>
            <td></td>
            <td>{currency.rates.FJD}</td>
            <td></td>
          </tr>
        </tbody>
      </table>
    </>
  );
}

export default CurrencyTable;
